-- ----------------------------
-- Procedure structure for EXEC_DATATESTING
-- ----------------------------
DROP PROCEDURE IF EXISTS `EXEC_DATATESTING`;
delimiter ;;
CREATE PROCEDURE `EXEC_DATATESTING`(IN tglawal date, IN tglakhir date,IN tipe VARCHAR(5))
BEGIN
DELETE FROM tmpdatatesting WHERE kelompok = tipe;

INSERT INTO tmpdatatesting
SELECT
0 id,b.id,b.NmCUstomer,b.intervalbeli,b.Jumlah,b.Target,
CASE WHEN 
	b.Jarak >= (SELECT min FROM app_setting where Keterangan = 'Dekat') AND
	b.Jarak <= (SELECT max FROM app_setting where Keterangan = 'Dekat') THEN
	'Dekat'
ELSE
	CASE WHEN 
	b.Jarak > (SELECT min FROM app_setting where Keterangan = 'Jauh') AND
	b.Jarak < (SELECT max FROM app_setting where Keterangan = 'Jauh') THEN
	'Jauh'
    ELSE ''
	END
END Lokasi,
CASE WHEN 
	b.Jumlah >= (SELECT min FROM app_setting where Keterangan = 'Sangat Sedikit') AND
    b.Jumlah <= (SELECT max FROM app_setting where Keterangan = 'Sangat Sedikit') THEN
    'Sangat Sedikit'
ELSE
	CASE WHEN 
	b.Jumlah >= (SELECT min FROM app_setting where Keterangan = 'Sedikit') AND
    b.Jumlah <= (SELECT max FROM app_setting where Keterangan = 'Sedikit') THEN
    'Sedikit'
    ELSE
		CASE WHEN 
		b.Jumlah >= (SELECT min FROM app_setting where Keterangan = 'Banyak') AND
		b.Jumlah <= (SELECT max FROM app_setting where Keterangan = 'Banyak') THEN
		'Banyak'
        ELSE
			CASE WHEN 
			b.Jumlah >= (SELECT min FROM app_setting where Keterangan = 'Sangat Banyak') AND
			b.Jumlah <= (SELECT max FROM app_setting where Keterangan = 'Sangat Banyak') THEN
			'Sangat Banyak'
            ELSE ''
            END
		END
    END
END Pembelian,
tipe
FROM (
-- 	select 
-- 		b.*,a.TglTransaksi,sum(a.Jumlah) Jumlah
-- 	from Transaksi a
-- 	LEFT JOIN mstr_pelanggan b on a.KdPelanggan = b.id
-- 	WHERE a.TglTransaksi BETWEEN tglawal AND tglakhir AND b.DL = tipe
-- 	group by b.id,b.NmCustomer,b.Jarak,b.intervalbeli,b.target,b.KelompokUsaha,b.Tipe
	SELECT a.*,b.TglTransaksi,sum(b.Jumlah) Jumlah FROM mstr_pelanggan a
	LEFT JOIN transaksi b on a.id = b.KdPelanggan
	WHERE b.TglTransaksi BETWEEN tglawal AND tglakhir AND a.DL = tipe
	group by a.id,a.NmCustomer,a.Jarak,a.intervalbeli,a.target,a.KelompokUsaha,a.Tipe
) b;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for EXEC_DATAUJI
-- ----------------------------
DROP PROCEDURE IF EXISTS `EXEC_DATAUJI`;
delimiter ;;
CREATE PROCEDURE `EXEC_DATAUJI`(IN tglawal date, IN tglakhir date,IN tipe VARCHAR(5))
BEGIN
DELETE FROM tmpdatatesting WHERE kelompok = tipe;

INSERT INTO tmpdatatesting
SELECT
0 id,b.id,b.NmCUstomer,b.intervalbeli,b.Jumlah,'' Target,
CASE WHEN 
	b.Jarak >= (SELECT min FROM app_setting where Keterangan = 'Dekat') AND
	b.Jarak <= (SELECT max FROM app_setting where Keterangan = 'Dekat') THEN
	'Dekat'
ELSE
	CASE WHEN 
	b.Jarak > (SELECT min FROM app_setting where Keterangan = 'Jauh') AND
	b.Jarak < (SELECT max FROM app_setting where Keterangan = 'Jauh') THEN
	'Jauh'
    ELSE ''
	END
END Lokasi,
CASE WHEN 
	b.Jumlah >= (SELECT min FROM app_setting where Keterangan = 'Sangat Sedikit') AND
    b.Jumlah <= (SELECT max FROM app_setting where Keterangan = 'Sangat Sedikit') THEN
    'Sangat Sedikit'
ELSE
	CASE WHEN 
	b.Jumlah >= (SELECT min FROM app_setting where Keterangan = 'Sedikit') AND
    b.Jumlah <= (SELECT max FROM app_setting where Keterangan = 'Sedikit') THEN
    'Sedikit'
    ELSE
		CASE WHEN 
		b.Jumlah >= (SELECT min FROM app_setting where Keterangan = 'Banyak') AND
		b.Jumlah <= (SELECT max FROM app_setting where Keterangan = 'Banyak') THEN
		'Banyak'
        ELSE
			CASE WHEN 
			b.Jumlah >= (SELECT min FROM app_setting where Keterangan = 'Sangat Banyak') AND
			b.Jumlah <= (SELECT max FROM app_setting where Keterangan = 'Sangat Banyak') THEN
			'Sangat Banyak'
            ELSE ''
            END
		END
    END
END Pembelian,
tipe
FROM (
		SELECT a.*,b.TglTransaksi,sum(b.Jumlah) Jumlah FROM mstr_pelanggan a
	LEFT JOIN transaksi b on a.id = b.KdPelanggan
	WHERE b.TglTransaksi BETWEEN tglawal AND tglakhir AND a.DU = tipe
	group by a.id,a.NmCustomer,a.Jarak,a.intervalbeli,a.target,a.KelompokUsaha,a.Tipe
) b;
END
;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
